window.bookSummaryJSON = "<p>What would you do if there weren't any consequences?</p> <p>After 20 years on the force, Detective Chief Inspector Jack Logan thinks he has seen it all.</p> <p>He is wrong.</p> <p>When a nurse is murdered on her way home from nightshift, Jack and his team go on the hunt for her killer.</p> <p>As more victims are uncovered, Jack finds himself tracking a murderer afflicted by a unique psychosis - one that leaves him free to maim and kill without a shred of remorse.</p> <p>Facing a new type of killer in an unfamiliar city, DCI Jack Logan is about to be pushed to his limits, before being forced to realize just how little he truly knows.</p> <p><b><i>The Killing Code</i></b><b> is the third DCI Jack Logan crime thriller, and perfect for fans of Ian Rankin, Chris Brookmyre, and LJ Ross.</b></p>"; 
